import React from 'react'
import AdminNavbar from './AdminNavbar'

function Dashboard() {
  return (
    <div>
      <AdminNavbar/>
      <h1>Welcome!</h1>
      <h2>You are the admin account.</h2>
    </div>
  )
}

export default Dashboard
